    data: |
      SELECT ALL 41 + - ( - col2 ) + - col0 / CAST ( NULL AS INTEGER ) col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE 81 BETWEEN + + col2 AND ( - 12 * col2 + - 11 - - + col2 );
  - name: tab0

outputs:
  - name: q3449.out
    data: |
